1.0.0 · [source](https://doc.rust-lang.org/1.80.0/src/alloc/collections/btree/map/entry.rs.html#479)

Gets a mutable reference to the value in the entry.

If you need a reference to the `OccupiedEntry` that may outlive the destruction of the `Entry` value, see [`into_mut`](about:blank/struct.OccupiedEntry.html#method.into_mut "method std::collections::btree_map::OccupiedEntry::into_mut").

##### [§](#examples-3)Examples

```
use std::collections::BTreeMap;
use std::collections::btree_map::Entry;

let mut map: BTreeMap<&str, usize> = BTreeMap::new();
map.entry("poneyland").or_insert(12);

assert_eq!(map["poneyland"], 12);
if let Entry::Occupied(mut o) = map.entry("poneyland") {
    *o.get_mut() += 10;
    assert_eq!(*o.get(), 22);

    // We can use the same Entry multiple times.
    *o.get_mut() += 2;
}
assert_eq!(map["poneyland"], 24);
```

